// NoteList.js
import React from "react";

function NoteList({ notes }) {
  return (
    <div className="note-list">
      <h2>Notes</h2>
      <ul>
        {notes.map((note, index) => (
          <li key={index}>{note}</li>
        ))}
      </ul>
    </div>
  );
}

export default NoteList;
